import React from 'react'
import {Information, Equipment} from '../../../Common'
import {Grid } from '@material-ui/core'
import { useStyles } from '../../style'

const SUBMENU = [
  {id: 1, title: 'Resumen', path: '/resumen'}, 
  {id: 2, title: 'Deformaciones', path: '/camera-geometry/deformaciones'}, 
  {id: 3, title: 'Ángulo cámara', path: '/camera-geometry/angulo-camara'}
]

const AnguloCamara = props => {
  const classes = useStyles()
  return(
    <React.Fragment>
      <Grid container className={classes.root} direction="row" justify="center" spacing={2}>
        <Grid item xs={12}>
          <Equipment  submenu={SUBMENU}/>
        </Grid>
        <Grid item xs={12}>
            AnguloCamara
        </Grid>
      </Grid>
    </React.Fragment>
  )
}

export { AnguloCamara }
